import React from 'react'

const Card = ({ resData }) => {


  return (
    <div className='border border-red-500 w-[400px] h-[300px] flex justify-between m-5'>
      <h1 className='font-[700] text-[30px] flex justify-center items-center'>{resData.show.name}</h1>
      <div> {resData.show.image === null ?
        <div>No image </div> : <img alt='nothing'
          src={resData.show.image.medium}

        />}
      </div>




    </div>
  )
}

export default Card
